import React, { Component } from 'react'

class Header extends Component {
  render() {
    return (
      <header>
        <button type="button">
          <img src="https://miro.medium.com/max/2400/1*_8rYOyJj9qiQsmeoVk3Gfg.png" alt="" />
        </button>
        <p>Trybe Logo</p>
        <h4>Trybe</h4>
      </header>
    )
  }
}

export default Header;
